  const [games, setGames] = useState([])

  const handelToggleActive = () => {
    setActive(!active);
  };

  return (
    <main>
        <SideMenu active={active} />
        <div className={`banner ${active ? 'active' : undefined}`}>
          <Header toggleActive={handelToggleActive} />
          <div className="container-fliud">
            <Home />
          </div>
        </div>
    </main>
  )
}

export default Main;
